import Signup from './Signup';
import Login from './Login';
import Home from './Home';
import {
  BrowserRouter as Router,Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/">
            <Home/>
          </Route>
          <Route exact path="/login">
            <Login />
          </Route>
          <Route exact path="/signup">
            <Signup />
          </Route>
        </Routes>
      </Router >
    </div >
  );
}


export default App;
